import React, { useState } from "react";
import PropTypes from "prop-types";

const ListUserFormElementsComponent = (props) => {
  const [UserFormElements, setUserFormElements] = useState([]);

  return (
    <div className="container">
      <h2 className="text-center"> User Form </h2>
      <table className="table table-bordered table-striped"></table>
      <thead>
        <th>Title</th>
        <th>Key</th>
        <th>Type</th>
        <th>Required</th>
        <th>Actions</th>
      </thead>
      <tbody>
        {UserFormElements.map((form_element) => (
          <tr key={form_element.id}>
            <td>{form_element.title}</td>
            <td>{form_element.key}</td>
            <td>{form_element.type}</td>
            <td>{form_element.required}</td>
          </tr>
        ))}
      </tbody>
    </div>
  );
};

ListDefaultElementsComponent.propTypes = {};

export default ListDefaultElementsComponent;
